(701, 1, '2011-05-20 18:49:43', '2011-05-21 01:49:43', 'Use this static Page to test the Theme\'s handling of the Front Page template file.\n\nThis is the Front Page content. Use this static Page to test the Front Page output of the Theme. The Theme should properly handle both Blog Posts Index as Front Page and static Page as Front Page.\n\nIf the site is set to display the Blog Posts Index as the Front Page, then this text should not be visible. If the site is set to display a static Page as the Front Page, then this text may or may not be visible. If the Theme does not include a front-page.php template file, then this text should appear on the Front Page when set to display a static Page. If the Theme does include a front-page.php template file, then this text may or may not appear.', 'Front Page', '', 'publish', 'open', 'closed', '', 'front-page', '', '', '2018-04-05 12:33:45', '2018-04-05 10:33:45', '', 0, 'http://wpthemetestdata.wordpress.com/?page_id=701', 0, 'page', '', 0),
