(2165, 1, '2016-07-03 08:09:33', '2016-07-03 08:09:33', 'This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://ravistheme.com/puna/wp/dark/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2018-04-05 12:33:45', '2018-04-05 10:33:45', '', 0, 'http://ravistheme.com/puna/wp/dark/?page_id=2', 0, 'page', '', 0),
(2169, 1, '2016-07-03 08:10:13', '2016-07-03 08:10:13', '<p>Your Name (required)<br />\n    [text* your-name] </p>\n\n<p>Your Email (required)<br />\n    [email* your-email] </p>\n\n<p>Subject<br />\n    [text your-subject] </p>\n\n<p>Your Message<br />\n    [textarea your-message] </p>\n\n<p>[submit \"Send\"]</p>\nPuna – Single Property Real estate Template \"[your-subject]\"\n[your-name] <wordpress@ravistheme.com>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on Puna – Single Property Real estate Template (http://ravistheme.com/puna/wp/dark)\nravistheme@gmail.com\nReply-To: [your-email]\n\n0\n0\n\nPuna – Single Property Real estate Template \"[your-subject]\"\nPuna – Single Property Real estate Template <wordpress@ravistheme.com>\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on Puna – Single Property Real estate Template (http://ravistheme.com/puna/wp/dark)\n[your-email]\nReply-To: ravistheme@gmail.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2016-07-03 08:10:13', '2016-07-03 08:10:13', '', 0, 'http://ravistheme.com/puna/wp/dark/?post_type=wpcf7_contact_form&amp;p=3', 0, 'wpcf7_contact_form', '', 0),
