(2203, 1, '2018-04-05 12:25:23', '2018-04-05 10:25:23', 'Voici un exemple de page. Elle est différente d’un article de blog, en cela qu’elle restera à la même place, et s’affichera dans le menu de navigation de votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\r\n<blockquote>Bonjour ! Je suis un mécanicien qui aspire à devenir un acteur, et ceci est mon blog. J’habite à Bordeaux, j’ai un super chien qui s’appelle Russell, et j’aime la vodka-ananas (ainsi que perdre mon temps à regarder la pluie tomber).</blockquote>\r\n...ou bien quelque chose comme cela :\r\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis cette année. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\r\nÉtant donné que vous êtes un nouvel utilisateur ou une nouvelle utilisatrice de WordPress, vous devriez vous rendre sur votre <a href=\"http://koulchizine.com/wp-admin/\">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !', 'Page d’exemple', '', 'inherit', 'closed', 'closed', '', '2-autosave-v1', '', '', '2018-04-05 12:25:23', '2018-04-05 10:25:23', '', 2, 'http://koulchizine.com/2018/04/05/2-autosave-v1/', 0, 'revision', '', 0),
(2204, 1, '2018-04-05 12:26:21', '2018-04-05 10:26:21', '[puna-main-slider][puna-text-section type=\"with-buttons\" title=\"Single Property Real Estate Theme\" text=\"Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eos nostrum error veniam saepe mollitia debitis tempore quia accusantium porro explicabo quod magni modi, perferendis rem beatae dolorem harum incidunt maxime rerum. Est reiciendis voluptatum laudantium eaque. Unde accusantium quae id, veniam dolore corrupti sit nostrum pariatur ea! Repellendus voluptatem fugit officia, quibusdam temporibus. Laborum, accusamus, eveniet. Nihil recusandae, officia consectetur, id consequatur fugit distinctio rerum, impedit aut culpa nemo officiis vitae optio. Ipsa esse dolores asperiores? Neque eos, repellendus veritatis, iste mollitia fuga, eveniet accusantium laudantium velit obcaecati, officiis cupiditate. Sint corporis voluptatem, natus amet? Vel cupiditate vitae, repellendus maxime.\" btn_1_text=\"Gallery\" btn_1_url=\"#\" btn_2_text=\"Contact Agent\" btn_2_url=\"#\" ][puna-property-specs][puna-main-gallery][puna-agent type=\"single\" agent_id=\"1508\" ][puna-attractions][puna-testimonials][puna-contact subtitle=\"Lorem ipsum dolor sit amet, consectetur adipisicing elit. Iure error incidunt, amet recusandae ex sint odit.\" ]', 'Accueil', '', 'inherit', 'closed', 'closed', '', '1492-revision-v1', '', '', '2018-04-05 12:26:21', '2018-04-05 10:26:21', '', 1492, 'http://koulchizine.com/2018/04/05/1492-revision-v1/', 0, 'revision', '', 0),
(2205, 1, '2018-04-05 12:30:01', '2018-04-05 10:30:01', 'Use this static Page to test the Theme\'s handling of the Front Page template file.\n\nThis is the Front Page content. Use this static Page to test the Front Page output of the Theme. The Theme should properly handle both Blog Posts Index as Front Page and static Page as Front Page.\n\nIf the site is set to display the Blog Posts Index as the Front Page, then this text should not be visible. If the site is set to display a static Page as the Front Page, then this text may or may not be visible. If the Theme does not include a front-page.php template file, then this text should appear on the Front Page when set to display a static Page. If the Theme does include a front-page.php template file, then this text may or may not appear.', 'Front Page', '', 'inherit', 'closed', 'closed', '', '701-revision-v1', '', '', '2018-04-05 12:30:01', '2018-04-05 10:30:01', '', 701, 'http://koulchizine.com/2018/04/05/701-revision-v1/', 0, 'revision', '', 0),
